    const result=num1+num2
    console.log(result*5)
  }

  add(2,3)





  return (
    <div className="App">
        <div>hello {name}</div>
      {arr.map((item,index)=>{

        return(
          <div key={index}>{item}</div>
        )
      })}
    </div>
  );
}

export default App;
